function sharpenBase64(base64, callback) {
    const img = new Image();
    img.onload = () => {
        const canvas = document.createElement('canvas');
        canvas.width = img.width;
        canvas.height = img.height;
        const ctx = canvas.getContext('2d');
        ctx.drawImage(img, 0, 0);

        // Берём пиксели
        const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
        const data = imageData.data;

        // Простой sharpen-фильтр (Laplacian + оригинал)
        const sharpen = [
            0, -1,  0,
           -1,  5, -1,
            0, -1,  0
        ];

        const tempData = new Uint8ClampedArray(data);

        for (let y = 1; y < canvas.height - 1; y++) {
            for (let x = 1; x < canvas.width - 1; x++) {
                for (let channel = 0; channel < 3; channel++) { // R,G,B
                    let sum = 0;
                    let index = 0;
                    for (let dy = -1; dy <= 1; dy++) {
                        for (let dx = -1; dx <= 1; dx++) {
                            const pos = ((y + dy) * canvas.width + (x + dx)) * 4 + channel;
                            sum += tempData[pos] * sharpen[index++];
                        }
                    }
                    const targetPos = (y * canvas.width + x) * 4 + channel;
                    data[targetPos] = Math.min(255, Math.max(0, sum));
                }
            }
        }

        ctx.putImageData(imageData, 0, 0);
        callback(canvas.toDataURL('image/jpeg', 0.95));
    };
    img.src = base64;
}

// Пример использования:
sharpenBase64("data:image/jpeg;base64,", newBase64 => {
    console.log(newBase64);
    // можно document.getElementById('img').src = newBase64;
});